    if (!to.path || !data) {
      return;
    }
    const head = Object.assign({}, data?.head || {});
    head.meta = [...head.meta || []];
    head.link = [...head.link || []];
    const title = head.title || data?.title;
    if (title) {
      head.title = title;
      if (!head.meta.some((m) => m.property === "og:title")) {
        head.meta.push({
          property: "og:title",
          content: title
        });
      }
    }
